import React from 'react';

// material-ui
import { Autocomplete, CardContent, Checkbox, FormControlLabel, Grid, MenuItem, TextField } from '@material-ui/core';

// project imports
import { gridSpacing } from 'store/constant';
import SubCard from 'ui-component/cards/SubCard';
import MaskedInput from 'react-text-mask';

const OrganizationsDetails = () => (
    <Grid container spacing={gridSpacing}>
        <Grid item xs={12} sm={12} lg={8} md={8}>
            <SubCard title='Organizations involved Upon Referral'>
                <CardContent>
                    <Grid container spacing={gridSpacing}>
                        <Grid item xs={12} sm={12} lg={12} md={12}>
                            <Autocomplete
                                disablePortal
                                options={referralSourcesList}
                                defaultValue={referralSourcesList[0]}
                                renderInput={(params) => <TextField {...params} label="Referral Source" />}
                            />
                        </Grid>
                    </Grid>
                </CardContent>
            </SubCard>

            Organization responsible for Client Case Management
        </Grid>
    </Grid>
);

export default OrganizationsDetails;
